//SPDX-License-Identifier:MIT
pragma solidity 0.8.7;

contract RegisterAndLogin{
    struct User{
        bytes32 name;
        bytes32 password;
        bool register;
        bool login;
    }

    mapping(address => User) public details;

    //events
    event registeredUser(address indexed user,bytes32 indexed name);
    event loginUser(address indexed user, bytes32 indexed name);
    event logoutUser(address indexed user);

    //modifiers
    modifier registerTheUser{
        require(details[msg.sender].register==false,"aleardy user");
        _;
    }

    modifier loginTheUser(bytes32 _name,bytes32 _password){
        require(details[msg.sender].register!=false,"register first");
        require(details[msg.sender].name == _name,"user not existed. create Account");
        require(details[msg.sender].password ==_password,"Inccorrect password entered");
        _;
    }

    modifier logoutTheUser{
        require(details[msg.sender].login==true,"Login first to Logout");
        _;
    }


    //functions 
    function registerUser(bytes32 _name,bytes32 _password)external registerTheUser{
        details[msg.sender].name = _name;
        details[msg.sender].password = _password;
        details[msg.sender].register=true;
        emit registeredUser(msg.sender,_name);
    }

    function CheckUserToLogin(bytes32 _name,bytes32 _password)external loginTheUser(_name,_password) returns(bool ){
        details[msg.sender].login=true;
        emit loginUser(msg.sender,_name);
        return true;
    }

    function checkUserToLogOut()external logoutTheUser returns(bool ){
        details[msg.sender].login=false;
        emit logoutUser(msg.sender);
        return true;
    }

    
    function printUserName()external view returns(bytes32 ){
        require(details[msg.sender].login==true,"you cant view");
        return details[msg.sender].name;
    }

    function printPassword()external view returns(bytes32 ){
        require(details[msg.sender].login==true,"you cant view");
        return details[msg.sender].password;
    }

    //forget password
    function forgetPassword(bytes32 _userName,bytes32 _newPassword)external returns(bool){
        require(details[msg.sender].name == _userName,"you are not the owner of account");
        details[msg.sender].password=_newPassword;
        return true;
    }
}

